export default async function getCurrentWeather(location) {

    const axios = require('axios');

    console.log('aaa ' + location)

    var result = []
    console.log(`GET ---> http://history.openweathermap.org/data/2.5/history/city?q=${await location}&appid=a10534631766659c98a684169d309aa5`)
    axios.get(`api.openweathermap.org/data/2.5/weather?q=${await location}&appid=a10534631766659c98a684169d309aa5`).then((result) => {
        const data = result.data
        console.log(data)
    }).catch((err) => {
        console.log(err)
    });
}
